import React from "react";
import UserItem from "../users/UserItem";

const Users = (props) => {
  return (
    <div style={userStyle}>
      {this.props.users.map((user) => (
        <UserItem key={user.id} user={user} />
      ))}
    </div>
  );
};

const userStyle = {
  display: "grid",
  gridTemplateColumns: "repeat(3, 1fr)",
  gridGap: "1 rem",
};
export default Users;
